export function convertTo12Hour(isEnabled, time, timezone = moment.tz.guess()) {
    let estTimezone = 'America/New_York'
    // Ensure the time has both hours and minutes (fallback to '00' minutes if not provided)
    if (time.length !== 5) {
        time = time + ":00"; // Append ':00' if only hours are provided
    }
    // Get today's date and combine it with the provided time in EST
    let today = moment().tz(estTimezone).format('YYYY-MM-DD'); // Get today's date in 'YYYY-MM-DD' format in EST

    // Combine today's date with the provided time and parse it into a moment object in EST
    let dateTimeInEST = moment.tz(`${today} ${time}`, 'YYYY-MM-DD HH:mm', estTimezone);

    // Convert the EST time to the local timezone
    let dateTimeInLocal = dateTimeInEST.clone().tz(timezone);

    // Format it into 12-hour or 24-hour time with AM/PM
    let formattedTime = isEnabled
        ? dateTimeInLocal.format('hh:mm A') // 12-hour format with AM/PM
        : dateTimeInLocal.format('HH:mm A'); // 24-hour format without AM/PM

    return formattedTime;
}

