const getESTOffset = () => {
    const now = new Date();

    // Get the EST/EDT time zone offset in minutes
    const estOffsetMinutes = new Intl.DateTimeFormat('en-US', {
        timeZone: 'America/New_York',
        timeZoneName: 'short',
    })
        .formatToParts(now)
        .find(part => part.type === 'timeZoneName').value
        .includes('EDT') ? -4 * 60 : -5 * 60;

    return estOffsetMinutes / 60; // Convert minutes to hours
};

export function isTimePast(inputTime) {
    // console.log({ inputTime });

    // Get the current date and time in EST
    const now = new Date();

    // Split the input time into the time and the period (AM/PM)
    const [time, period] = inputTime.split(' '); // e.g., "3:00" and "PM"

    // Split the time into hours and minutes
    let [hours, minutes] = time.split(':').map(Number);

    // Convert 12-hour format to 24-hour format
    if (period === 'PM' && hours < 12) {
        hours += 12; // Add 12 to hours for PM times, except for 12 PM which is noon
    }
    if (period === 'AM' && hours === 12) {
        hours = 0; // 12 AM is midnight
    }

    // Get the current time in EST
    const offset = now.getTimezoneOffset() / 60; // Current local offset in hours
    const EST_OFFSET = getESTOffset(); // EST offset in hours
    const currentDateEST = new Date(now.getTime() + (offset + EST_OFFSET) * 60 * 60 * 1000);


    // Create a new Date object for the input time in EST
    const inputDateEST = new Date(
        currentDateEST.getFullYear(),
        currentDateEST.getMonth(),
        currentDateEST.getDate(),
        hours,
        minutes,
        0
    );
    // console.log({ currentDateEST, inputDateEST });

    // Check if the input time in EST is in the past
    return inputDateEST < currentDateEST;
}

export function isTimePast2(inputTime) {
    // Get the current time in the 'America/New_York' timezone
    const currentEST = moment().tz('America/New_York');

    // Parse the input time as a moment object (it includes a timezone offset)
    const inputEST = moment.tz(inputTime, 'America/New_York');

    // Compare the input time with the current time
    return inputEST.isBefore(currentEST);
}

