export const formatNumberWithCommas = (number) => {
    if (number) {
        return number.toLocaleString('en-US', { minimumFractionDigits: 2, maximumFractionDigits: 2 });
    } else {
        return 0
    }
};

export function formatToTwoDecimalPlaces(number) {
    if (number) {
        return parseFloat(number).toFixed(2);
    } else {
        return '0.00'
    }
}

export function formatToTwoDecimalPlacesbet(number) {
    if (!number) return '0.00';

    let numStr = number.toString().trim(); // Convert to string

    // If the number is extremely large, handle it as a string
    if (numStr.includes('e') || numStr.length > 15) {
        if (numStr.includes('.')) {
            // If it already has decimals, round it manually
            let [intPart, decPart] = numStr.split('.');
            decPart = decPart.substring(0, 2); // Keep only two decimal places
            return `${intPart}.${decPart.padEnd(2, '0')}`;
        }
        return `${numStr}.00`; // If no decimals, just append ".00"
    }

    // For normal numbers, use toFixed(2)
    let num = parseFloat(numStr);
    if (isNaN(num)) return '0.00';

    return num.toFixed(2);
}

